    $scope.porcentaje = function(cant,total){
      if (total == 0){
        return 0
      };
      var result = (cant * 100)/ total;
      return (Math.round( result * 10 ) / 10);
    };

    $scope.buildTableBody = function(data, columns) {
      var body = [];

      body.push(['Nombre','Cantidad','Porcentaje(%)']);

      data.forEach(function(row) {
          var dataRow = [];

          columns.forEach(function(column) {
              dataRow.push(row[column].toString());
          });

          body.push(dataRow);
      });



      return body;
    };
    $scope.buildTableBodyCustom = function(data, columns) {
      var body = [];

      body.push(['n°','Nombre','Rut']);

      data.forEach(function(row) {
          var dataRow = [];

          columns.forEach(function(column) {
              dataRow.push(row[column].toString());
          });

          body.push(dataRow);
      });



      return body;
    };


    $scope.table = function(data, columns) {
        return {
            table: {
                headerRows: 1,
                body: $scope.buildTableBody(data, columns)
            }
        };
    };

    $scope.tableCustom = function(data, columns) {
        return {
            table: {
                headerRows: 1,
                body: $scope.buildTableBodyCustom(data, columns)
            }
        };
    };

